import React from 'react';

const sidebar = (props) => {  
  return(
        <div>
        <a href="#">
          <span style={{marginRight:"20px"}}><img style={{width:"20px"}} src = {props.image} alt=""/></span>
          <span>{props.name}</span>
                  </a><br/>
        <br/>
      </div>
    );
}

export default sidebar;
